ownedComment.body:
This activity consists of defining
1)	the organization of the Business Processes, starting from a top-level node (representing the overall business goal). Refinements can be made using AND-decompositions, OR-decompositions, "include" associations and "extend" associations. 
2)	for each Business Process and each activity within a Business Process: 
i)	the definition (i.e. a description of the activity);
ii)	the trigger (i.e. an event that causes the start of the activity);
iii)	the pre-conditions (i.e. conditions that must be fulfilled in order to start the activity);
iv)	the post-conditions (i.e. conditions that must be fulfilled when the activity is completed);
v)	the arguments (i.e. information that is required, created or changed for the execution of the activity);

3)	the Business Roles that are relevant for the defined Business Process(es). A Business Role also applies to any Business Processes that are extended or included from the owning Business Process.
